import './App.css';

import Main from './components/main'
import {BrowserRouter as Router ,Route , Routes } from 'react-router-dom'; 
import Chaturl from './pages/chaturl';
function App() {

  return (
    <div className="App">
      <Router>
          <Main />
          <div style={{overflow:'hidden' ,width:'auto' , height:'800px'}}>
          <Routes>
          <div  style={{ backgroundColor: 'white' , overflow:'hidden' ,width:'auto' , height:'800px'}} >
          <Route path="/Chaturl/:chatbotsId" element={<Chaturl />} /></div>
          </Routes></div>

      </Router>

    </div>
  );
}

export default App;
<div   style={{ backgroundColor: 'white' , overflow:'hidden' ,width:'auto' , height:'800px'}}>
